import React from 'react';
import Card from './Card';
import './CardList.css';
const CardList = ({ robots }) => {
    const cardsArray = robots.map((user, i) => {
        return (
            <div className >
                <Card   
                key={i} 
                id={robots[i].id} 
                name={robots[i].name} 
                email={robots[i].email}
            />  
            </div>
        )
    })
    return(
        <div>
            {cardsArray}
        </div>
    );
}

export default CardList;
